INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (24001, 321, 2, 1, 0, 125801, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 40011, "リリ", 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (24001, 322, 2, 2, 0, 126001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 40011, "クリア", 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (24001, 323, 2, 3, 0, 126101, "んーと。\nこれ、あげる。\nはい", 1, 40011, "プレシア", 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (24001, 324, 2, 4, 0, 125801, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 40011, "リリ", 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (24001, 325, 2, 5, 0, 126001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 40011, "クリア", 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (24001, 326, 2, 6, 0, 126101, "お兄。\nきてくれて、うれしい", 2, 40011, "プレシア", 1);
